    <body style="display:none;">

    <div class="container p-3">
        <div class="row">
            <div class="col-sm-8"><h2>Lista de <b>PQRS</b></h2></div>
            <div class="col-sm-4 text-right">
                <button type="button" class="btn btn-primary" data-toggle="modal" data-target="#exampleModal" data-whatever="@mdo">Open modal for @mdo</button>
            </div>
        </div>

        <table
        id="table"
        
        data-total-field="count"
        data-data-field="items"

        data-pagination="true"
        
        data-show-export="true"
        data-search="true"
        data-advanced-search="true"
        data-id-table="advancedTable">
        <thead>
            <tr>
            <th data-field="id">ID</th>
            <th data-field="tipo">Tipo</th>
            <th data-field="nombre">Usuario</th>
            <th data-field="asunto">Asunto</th>
            <th data-field="mensaje">Mensaje</th>
            <th data-field="estado">Estado</th>
            <th data-field="fecha">Fecha</th>
            
            <th data-formatter="operateFormatter"
            data-events="operateEvents">Acciones</th>
            </tr>
        </thead>
        </table>
    </div>

        <div class="modal fade" id="exampleModal" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
        <div class="modal-dialog" role="document">
            <div class="modal-content">
            <div class="modal-header">
                <h5 class="modal-title" id="exampleModalLabel">New message</h5>
                <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                <span aria-hidden="true">&times;</span>
                </button>
            </div>
            <div class="modal-body">
                <form>
                <div class="form-group">
                    <label for="recipient-name" class="col-form-label">Recipient:</label>
                    <input type="text" class="form-control" id="recipient-name">
                </div>
                <div class="form-group">
                    <label for="message-text" class="col-form-label">Message:</label>
                    <textarea class="form-control" id="message-text"></textarea>
                </div>
                </form>
            </div>
            <div class="modal-footer">
                <button type="button" class="btn btn-secondary" data-dismiss="modal">Close</button>
                <button type="button" class="btn btn-primary">Send message</button>
            </div>
            </div>
        </div>
        </div>

    </body>
</html>